  false,\n\t\"url\": null,\n\t\"notes\": \"Chemical, laboratory analyses, physical
  and profile oceanographic data were collected aboard the JACK FITZ in the Gulf of
  Mexico from 2010-06-12 to 2010-06-20 in response to the Deepwater Horizon Oil Spill
  Event on April 20, 2010, by the Subsurface Monitoring Unit (SMU), which consisted
  of multiple government and corporate agencies. These data include Semivolatile Organic
  Compounds, Total Petroleum Hydrocarbons (TPH), Volatile Organic Compounds, conductivity,
  dissolved oxygen, fluorescence, hydrostatic pressure, salinity, sound velocity,
  temperature and water density. The instruments used to collect these data included
  CTD, bottle, fluorometer and oxygen meter along with other physical sampling devices.
  The CTD data underwent preliminary quality assurance and control procedures at the
  National Coastal Data Development Center (NCDDC). The analytical chemistry data
  are provisional and provide results of onshore laboratory analysis of water and
  sediment samples. (NODC Accession 0069074)\",\n\t\"license_title\": null,\n\t\"extras\":
